import React, {useContext} from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../../auth/AuthContext';
import Button from '@material-ui/core/Button';
import './NavLinks.css'


export default function NavLinks() {

    const {authenticated, logOut } = useContext(AuthContext);

    return (
        <ul>
            {!authenticated &&
            <li><Link to="/signup" className="headerLink">Signup</Link></li>  } 
            {!authenticated ?
            <li><Link to="/login"><Button className="headerLink" >Login</Button></Link></li>:
            <li><Link to="/login"><Button onClick={logOut} className="headerLink" >Logout</Button></Link></li> }
            {authenticated &&
            <li><Link to="/training-tab"><Button className="headerLink" >Training</Button></Link></li> }
        </ul>
    )
}
